import React, { useState } from 'react'
import './CRUD.css'
function CRUD(){
    
        const list=[
            {
                id:1,
                name:"HP",
                price:"111"
            },
            {
                id:2,
                name:"Dell",
                price:"222"
            },
            
        ]
        const[lists, setList]= useState(list)

        return(
            <div className="crud">
            <table>
            {
                lists.map((current)=>(
                    <tr>
                    <td>{current.name}</td>
                    <td>{current.price}</td>
                 
                    </tr>
                ))
            }
            </table>
            </div>
        )
}

export default CRUD;
